import Navbar from "./Components/Navbar";
import './App.css'
import Intro from "./Components/Intro/Intro";
import Services from "./Components/Services";

function App() {
  return (
    <div className="App">
      <Navbar/>
      <Intro/>
      <Services/>
    </div>
  );
}

export default App;
